// ==UserScript==
// @name         Diseño de tarjeta
// @version      0.5
// @description  Nuevo diseño de tarjeta mejorado!
// @author       Facu
// @match        https://clientes.pagospyme.com/cancelaciones/altacredencialpf.php*
// @match        http://127.0.0.1:5500/Credencial%20de%20pago.html
// @require      http://ajax.googleapis.com/ajax/libs/jquery/1.7.2/jquery.min.js
// @require      https://cdnjs.cloudflare.com/ajax/libs/html2canvas/1.4.1/html2canvas.min.js
// @require      https://cdnjs.cloudflare.com/ajax/libs/FileSaver.js/2.0.0/FileSaver.min.js
// @require      https://greasyfork.org/scripts/31940-waitforkeyelements/code/waitForKeyElements.js?version=209282
// @grant        GM_addStyle
// @run-at       document-start
// @namespace    http://tampermonkey.net/
// @downloadURL https://update.greasyfork.org/scripts/421436/Dise%C3%B1o%20de%20tarjeta.user.js
// @updateURL https://update.greasyfork.org/scripts/421436/Dise%C3%B1o%20de%20tarjeta.meta.js
// ==/UserScript==

GM_addStyle(`
    #destinatario, .texto {
        font-size: 30px !important;
    }

    #destinatario {
        width: fit-content!important;
        margin: auto;
        padding: 0!important;
        font-family: 'Circular Std', sans-serif;
    }

    .texto {
        margin-top: 0.4em!important;
        margin-bottom: 0.4em!important;
        font-family: 'Circular Std', sans-serif;
    }

    #tablacertificado {
        background: white;
        display: flex;
        justify-content: center;
        align-items: center;
        width: 700px!important;
        height: 434px!important;
        box-shadow: #5c5c5c 0px 0px 0px 3px inset;
    }

    #logopf {
        width: 620;
        margin-left: -15!important;
        margin-top: -40px;
    }

    center {
        width: fit-content;
    }

    body {
        width: fit-content;
        height: fit-content;
    }

    .container-t {
        display: flex;
        align-items: center;
        height: inherit;
        box-sizing: border-box;
        flex-direction: column;
        justify-content: space-around;
    }

    #btn {
        background: #009cde;
        border: none;
        border-radius: 5px;
        padding: 15px;
        color: white;
        margin: 10;
        box-sizing: border-box;
        border: 3px solid #00000000;
        transition: 0.1s ease;
    }

    #btn:active {
        background: #006f9f;
        border: 3px solid #00000038;
        box-sizing: border-box;
        transition: 0.1s ease;
    }

    #footer td img{
        width: 50%;
    }

    #footer td {
        display: flex;
        flex-direction: column;
        align-items: center;
    }

    #codigobarras > img {
        image-rendering: pixelated;
        width: 434px;
    }

    #nombre {
        font-weight: 700;
    }

    #amoc_logo {
        width: 500px
    }

`);

$(document).ready(function () {
    $('#destinatario').wrapInner('<p id="nombre"></p>')
    // Logo amoc
    $('#header').wrapInner('<img id="amoc_logo" src="data:image/png;base64,">')

    var para = $('#nombre').text();
    var nombre = para.replace('Para: ', '').replaceAll('\n', '').replaceAll('\t', '');
    var nombre_elem = para.replace('Para: ', '')

    $('#nombre').text(nombre_elem);

    $(".ocultoimpresion, #logocliente, #superior, #lateralizq1, #lateralizq2, #lateralder1, #lateralder2, , #textocliente, .separador, #logopf").remove()
    $("#footer td img").attr("src", "data:image/png;base64,");

    var urlImg = $("#codigobarras > img").attr('src');
    var urlImgNew = urlImg.replace('http', 'https');
    $("#codigobarras > img").attr('id', 'imgCodigo').attr('crossOrigin', 'anonymous');

    $("tbody").first().addClass("container-t")
    $("center > table > tbody > tr > td > table > tbody").addClass("container-s")
    $("head").append('<link href="https://fonts.cdnfonts.com/css/circular-std" rel="stylesheet">');
    $("body").after('<button id="btn">Imagen</button>')

    // CREAR IMAGEN!

    const toDataURL = url => fetch(url)
        .then(response => response.blob())
        .then(blob => new Promise((resolve, reject) => {
            const reader = new FileReader()
            reader.onloadend = () => resolve(reader.result)
            reader.onerror = reject
            reader.readAsDataURL(blob)
        }))

    toDataURL(urlImgNew)
        .then(dataUrl => {
            $("#imgCodigo").attr('src', dataUrl)
        })

    $("#btn").click(function () {
        html2canvas(document.querySelector("#tablacertificado")).then(canvas => {
            canvas.toBlob(function (blob) {
                window.saveAs(blob, 'Tarjeta - ' + nombre + '.jpeg');
            });
        });
    });
});

waitForKeyElements('style[id^="stylebot"]', function (e) {
    $('style[id^="stylebot"]').remove()
});
